import { NavLink } from "react-router-dom"

const Doctors = ({specialization, avatarUrl, fullName, experience }) => {
  return (
    <div className="specialists__item">
      <NavLink className="specialists__item-link" to="/specialist">
        <div className="specialists__item-foto">
          <img src={avatarUrl} alt="" />
          <p>{experience}</p>
        </div>
        <div className="specialists__item-info">
          <h4>Врач</h4>
          <p>{fullName}</p>
          <h4>Специализация</h4>
          <p>{specialization.join(', ')}</p>
        </div>
      </NavLink>
    </div>
  );
};

export default Doctors;
